import logo from './logo.svg';
import './App.css';
import React from 'react';
import {BrowserRouter, Route,Routes} from 'react-router-dom';
import GetAll from './components/AnimeCharacter/GetAll';
import GetOne from './components/AnimeCharacter/GetOne';
import CreateNew from './components/AnimeCharacter/CreateNew';





const App=()=> {

  return (
    <BrowserRouter>
      <div className="App">
         <Routes>
           <Route path='/' element={<GetAll/>}></Route>
           <Route path='/anime/:myid' element={<GetOne/>}></Route>
           <Route path='/anime/new' element={<CreateNew/>}></Route>

         </Routes>
      </div>
    </BrowserRouter>

  );
}

export default App;
